import styled from "@emotion/styled";

export const SideContainer = styled.div<{ testProps: boolean }>`
  position: fixed;
  top: 0;
  bottom: 0;
  left: 0;
  width: ${(props) => (props.testProps ? "20rem" : "5rem")};
  height: 100%;
  z-index: 99;
  background-color: black;
  color: white;
  transition: 0.4s ease;
  font-size: 3rem;
`;

export const ArrowContainer = styled.div`
  margin: 2rem 2rem 2rem 0;
  float: right;
`;

export const Arrow = styled.div<{ testProps: boolean }>`
  height: 1rem;
  width: 1rem;
  border: 2px solid white;
  border-width: 4px 4px 0 0;
  transition: 0.4s ease;
  transform: ${(props) =>
    props.testProps ? "rotate(225deg)" : "rotate(45deg)"};
`;

export const Logo = styled.div`
  font-family: Pretendard;
  font-size: 2rem;
  font-weight: 600;
  margin: 1.8rem 0 0 1.5rem;
`;
